const DATA = [
  {
    key: '1',
    stt: '1',
    date: '17-08-200',
    customer: 'Hien Sambi',
    nameProduct: 'Hoodies',
    quantity: 3,
    phoneCustomer: '01226445130',
    address: `Số nhà 5 phường 
                Hoàng Mai Quận 
                Đống Đa Hà Nội`,
    price: 16,
    total() {
      return this.price * this.quantity;
    },
  },
];

export default DATA;
